import { Avatar, Box, withStyles } from "@material-ui/core";
import React from "react";

interface IProps {}

const FindUsOnFB: React.FC<IProps> = () => {
  return (
    <Container>
        <Avatar src="/assets/"></Avatar>
      <div>Find us on fb</div>
    </Container>
  );
};

export default FindUsOnFB;

const Container = withStyles({
  root: {
    background: "#0380A7D4",
    padding: "1rem 4rem",
    color: "white",
    borderRadius: 50,
    marginBottom: "2rem",
    display: "inline-flex",
    fontWeight: 600,
    fontSize: "1.2rem",
  },
})(Box);
